import React, { useState } from 'react';
import openaiService from '../services/openaiService';

const GlobalAnalysis = () => {
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [category, setCategory] = useState('Electronics');

  const analyzeCategory = async () => {
    setLoading(true);
    try {
      const result = await openaiService.getGlobalMarketAnalysis(category);
      setAnalysis(result);
    } catch (error) {
      console.error('Analysis failed:', error);
    } finally {
      setLoading(false);
    }
  };

  const categories = [
    'Electronics', 'Fashion', 'Automotive', 'Home & Garden',
    'Health & Beauty', 'Sports', 'Toys', 'Industrial'
  ];

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">üåê Global Market Analysis</h1>
      
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Left Panel */}
        <div className="lg:col-span-2">
          <div className="bg-white rounded-xl shadow-lg p-6 mb-6">
            <h2 className="text-2xl font-bold mb-4">Category Analysis</h2>
            
            <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mb-6">
              {categories.map(cat => (
                <button
                  key={cat}
                  onClick={() => setCategory(cat)}
                  className={`p-4 rounded-lg text-center ${
                    category === cat 
                      ? 'bg-blue-600 text-white'
                      : 'bg-gray-100 hover:bg-gray-200'
                  }`}
                >
                  {cat}
                </button>
              ))}
            </div>

            <button
              onClick={analyzeCategory}
              disabled={loading}
              className="w-full bg-gradient-to-r from-green-500 to-emerald-600 text-white py-3 rounded-lg font-semibold text-lg hover:shadow-lg disabled:opacity-50"
            >
              {loading ? 'Analyzing Global Market...' : 'üåç Analyze Global Market'}
            </button>
          </div>

          {/* Results */}
          {analysis && (
            <div className="bg-white rounded-xl shadow-lg p-6">
              <h3 className="text-xl font-semibold mb-4">Global Insights</h3>
              <div className="space-y-4">
                {Object.entries(analysis.regions).map(([region, data]) => (
                  <div key={region} className="border-l-4 border-blue-500 pl-4 py-2">
                    <h4 className="font-bold text-lg">{region}</h4>
                    <div className="grid grid-cols-2 gap-2 text-sm">
                      <div>Avg Price: {data.averagePrice}</div>
                      <div>Trend: {data.priceTrend}</div>
                      <div>Demand: {data.marketDemand}</div>
                      <div>Best For: {data.bestFor.join(', ')}</div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}
        </div>

        {/* Right Panel - Key Metrics */}
        <div className="space-y-6">
          <div className="bg-gradient-to-r from-purple-600 to-pink-600 text-white rounded-xl p-6">
            <h3 className="text-xl font-semibold mb-2">Global Metrics</h3>
            <div className="text-4xl font-bold mb-2">99.9%</div>
            <p className="opacity-90">Accuracy Rate</p>
          </div>

          <div className="bg-white rounded-xl shadow-lg p-6">
            <h3 className="text-lg font-semibold mb-4">üìä Key Performance Indicators</h3>
            <div className="space-y-4">
              <div>
                <div className="flex justify-between mb-1">
                  <span>Market Growth</span>
                  <span className="font-bold">+15.2%</span>
                </div>
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div className="bg-green-500 h-2 rounded-full" style={{width: '75%'}}></div>
                </div>
              </div>
              
              <div>
                <div className="flex justify-between mb-1">
                  <span>Profit Margin</span>
                  <span className="font-bold">42.8%</span>
                </div>
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div className="bg-blue-500 h-2 rounded-full" style={{width: '85%'}}></div>
                </div>
              </div>
              
              <div>
                <div className="flex justify-between mb-1">
                  <span>Competition Index</span>
                  <span className="font-bold">Medium</span>
                </div>
                <div className="w-full bg-gray-200 rounded-full h-2">
                  <div className="bg-yellow-500 h-2 rounded-full" style={{width: '60%'}}></div>
                </div>
              </div>
            </div>
          </div>

          <div className="bg-white rounded-xl shadow-lg p-6">
            <h3 className="text-lg font-semibold mb-4">üí° Recommendations</h3>
            <ul className="space-y-3">
              <li className="flex items-start">
                <span className="text-green-500 mr-2">‚úì</span>
                <span>Expand to Asian markets for 35% higher margins</span>
              </li>
              <li className="flex items-start">
                <span className="text-green-500 mr-2">‚úì</span>
                <span>Add mobile money for African customers</span>
              </li>
              <li className="flex items-start">
                <span className="text-green-500 mr-2">‚úì</span>
                <span>Optimize pricing for EU VAT regulations</span>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default GlobalAnalysis;
